import React from 'react';
import Navbar from '../components/common/Navbar';

export default function Profile() {
  return (
    <div>
      <Navbar />
      <main style={{ padding: '2rem' }}>
        <h1>Your Profile</h1>
        <p>Profile details and account settings will appear here.</p>
      </main>
    </div>
  );
}
